import React from "react-native";
import { useState } from "react";
import {Container} from './styles';

type Props = {
    title?: string;
} 

export function CheckBoxComponent({title}: Props){

    const [checked, setChecked] = useState(false);

    return (
        <View>
            <CheckBox 
            title={title}
            checked={checked}
            onPress={() => setChecked(!checked)}
            />
        </View>
    );
}
